import './TaskItem.css'

const TaskItem = () => {
    return (
        <div className='task-item-container'>
            <div className='task-item-checkbox'>
                <button className='checkbox-circle-container' />
            </div>
            <div className='task-data-container'>
                <div className='task-title'>
                    Learn React
                </div>
                <div className='task-btn-container'>
                    <button className='task-item-btn' type="button">Edit</button>
                    <button className='task-item-btn' type="button">Days</button>
                </div>
            </div>
        </div>
    );
}

export default TaskItem;
